import * as React from 'react';
import { View} from 'react-native';
import { Button } from 'react-native-web';

import { Header,Container,Title,Left,HeaderButtonLeft,HeaderButtonRight} from './styles';


function BreakfastScreen({navigation}) {
    return (
      <View>
        <Header>
          <HeaderButtonLeft onPress={() => navigation.navigate('MealPlanner')}>
            <Ionicons name="chevron-back" size={20} color="black" />
          </HeaderButtonLeft>
          <HeaderButtonRight>
            <Entypo name="dots-two-horizontal" size={20} color="#1D1617" />
          </HeaderButtonRight>
        </Header>
        <Title>Breakfast</Title>
        <Container>
          <Left>Category</Left>
          <div className="App">
            <input type="text" placeholder="Search Pancake" />
          </div>
          <Button
            title="Go to Bluebarry Pancake"
            onPress={() => navigation.navigate('Bluebarry Pancake')}
          />
        </Container>
      </View>
    );
}
export default BreakfastScreen;
